import './UserMoneyStyle.css'
export default function UserMoney(props:any){
    let money =  props.money
    let totalMoney = props.totalMoney
    return(
        <div>
            <h4>Money : {money}</h4>
            <h5>Total Use Money : {totalMoney}</h5>
        </div>
    )
}
